import React from "react";

import "./App.css";
import Home from "./pages/Home";

function App() {
  return (
    <div className="app">
      <Router>
        <Switch>
          <Router path="/search>"></Router>
          <Home />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
